// src/components/Navbar/Navbar.jsx
import React from 'react';
import './Navbar.css';

const Navbar = ({ onSportSelect }) => {
  const handleSportSelect = (sport) => {
    onSportSelect(sport);
  };

  return (
    <nav className="navbar">
      <h1 className="title">Sports Connect</h1>
      <div className="buttons">
        <button onClick={() => handleSportSelect('cricket')}>Cricket</button>
        <button onClick={() => handleSportSelect('basketball')}>Basketball</button>
        <button onClick={() => handleSportSelect('football')}>Football</button>
        <button onClick={() => handleSportSelect('volleyball')}>Volleyball</button>
      </div>
    </nav>
  );
};

export default Navbar;
